from sympy import primerange, isprime
def ok(p):
    s = str(p)
    if len(s) == 1: return True
    return all(not isprime(int(s[:i])) for i in range(1, len(s)))
def aupto(lim):
    alst = []
    for p in primerange(1, lim+1):
        if ok(p): alst.append(p)
    return alst
